import { useState } from 'react';

export default function CreateProduct() {
  const [name, setName] = useState('Wes');
  const newName = () => {
    setName();
  };

  console.log(name);
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Name"
          value={name}
          onChange={newName}
        />
      </label>
    </form>
  );
}
